// src/admin/pages/Logout.js
import React from 'react';

const Logout = () => {
    return (
        <div className="container">
            <h2>Logout</h2>
            <p>Are you sure you want to logout?</p>
            <button>Logout</button>
        </div>
    );
};

export default Logout;
